import styled from 'styled-components';

export const Conteudo = styled.div `
  height: 100vh;
  width: 85vw;
  grid-column-start: 2;
  grid-column-end: 3;
  > div {
    height: 20vh;
    margin-left: 2vw;
  }
`;
